// Filename - components/Footer.js

import React from "react";
//import {
//	Box,
//	FooterContainer,
//	Row,
//	Column,
//	FooterLink,
//	Heading,
//} from "./FooterStyles";
import "./Footer.css"

const Footer = () => {
	return (
		<div className="box">
			
			<div className="footer-container">
				<div className="row">
					<div className="column">
						<p className="heading">About Us</p>
						<a href="#">
							Aim
						</a>
						<a href="#">
							Vision
						</a>
						<a href="#">
							Testimonials
						</a>
					</div>
					<div className="column">
						<p className="heading">Services</p>
						<a href="#">
							Fabric
						</a>
						<a href="#">
							Threads
						</a>
						<a href="./" >Metal Zippers</a>
					</div>
					<div className="column">
						<p className="heading">Contact Us</p>
						<a href="#">
							Address
						</a>
						<a href="/contactus">
							Email
						</a>
						<a href="#">
							Telephone
						</a>
					</div>
					<div className="column">
						<p className="heading">Our Links</p>
						<a href="#" className="fa-brands fa-facebook">
								<span
									style={{
										marginLeft: "10px",
									}}
								>
									Facebook
								</span>
						</a>
						<a href="#" className="fa-brands fa-instagram">
								<span
									style={{
										marginLeft: "10px",
									}}
								>
									Instagram
								</span>
						</a>
						<a href="#" className="fa-brands fa-x-twitter">
								<span
									style={{
										marginLeft: "10px",
									}}
								>
									Twitter
								</span>
						</a>
						<a href="#" className="fa-brands fa-youtube">
								<span
									style={{
										marginLeft: "10px",
									}}
								>
									Youtube
								</span>
						</a>
            <a href="#" className="fa-brands fa-shopify">
								<span
									style={{
										marginLeft: "10px",
									}}
								>
									Shopify
								</span>
						</a>
					</div>
				</div>
			</div>
		</div>
	);
};
export default Footer;
